  "MassIndex" should "produce the correct figures" in {
    var prevData = List.empty[TickData]

    forAll(testData) {(high: Double, low: Double, range: Double, emaOfRange: Option[Double], doubleEMA: Option[Double], ratio: Option[Double], index: Option[Double]) =>
      val data = TickData.getNextTick(Range(high, low), 0.0, 0.0, prevData, massIndex = true)
      data.range.range should be (range +- 0.01)
      data.massIndex match {
        case Some(x) =>
          TestHelpers.matchOptionDouble(x.emaOfRange, emaOfRange, 0.0000001)
          TestHelpers.matchOptionDouble(x.doubleEMA, doubleEMA, 0.0000001)
          TestHelpers.matchOptionDouble(x.ratio, ratio, 0.0000001)
          TestHelpers.matchOptionDouble(x.index, index, 0.0000001)
        case None => fail()
      }
      prevData = data :: prevData
    }
  }
}
